import React from 'react';
import { LineChart, Line } from 'recharts';


const Deshbord = () => {
    const data = [
        {
            "month": "Mar",
            "investment": 100000,
            "sell": 241,
            "revenue": 10401
        },
        {
            "month": "Apr",
            "investment": 200000,
            "sell": 423,
            "revenue": 24500
        },
        {
            "month": "May",
            "investment": 500000,
            "sell": 726,
            "revenue": 67010
        },
        {
            "month": "Jun",
            "investment": 500000,
            "sell": 529,
            "revenue": 40405
        },
        {
            "month": "Jul",
            "investment": 600000,
            "sell": 601,
            "revenue": 50900
        },
        {
            "month": "Aug",
            "investment": 700000,
            "sell": 670,
            "revenue": 61000
        }
    ]
    return (
        <div className='container'>
            <div className='aboutContainer'>
                {/* <h1>Deshbord</h1> */}

                <div className='deshbordContainer'>
                    <LineChart width={400} height={400}>
                        <Line dataKey="sell"></Line>
                    </LineChart>
                </div>
            </div>

        </div>
    );
}

export default Deshbord;
